import React from "react";
import "./Support.css";

const Support = () => {
  return (
    <div className="container">
      <h2>Need Help?</h2>
      <p>Contact our support team anytime at <b>support@example.com</b></p>
      <button>Live Chat</button>
    </div>
  );
};

export default Support;
